INSERT INTO kwalifikacja (id, nazwa, opis) VALUES (1, 'Poziom 1', 'Kwalifikacje niezbędne do wykonywania prostych, rutynowych zadań wykonywanych pod kierunkiem przełożonego, stanowiących podstawę do dalszych, bardziej specjalistycznych działań.');
INSERT INTO kwalifikacja (id, nazwa, opis) VALUES (2, 'Poziom 2', 'Kwalifikacje niezbędne do wykonywania zadań w sytuacjach typowych. Niektóre zadania mogą być bardziej złożone i wymagać działań samodzielnych charakteryzujących się indywidualną odpowiedzialnością. Wymagana może być również umiejętność pracy w zespole.');
INSERT INTO kwalifikacja (id, nazwa, opis) VALUES (3, 'Poziom 3', 'Kwalifikacje niezbędne do wykonywania zadań złożonych, zarówno w warunkach typowych jak i problemowych. Zadania charakteryzują się różnorodnością wykonywanych czynności, wymagają samodzielności i odpowiedzialności. Dotyczyć mogą również umiejętności kierowania pracą innych osób.');
INSERT INTO kwalifikacja (id, nazwa, opis) VALUES (4, 'Poziom 4', 'Kwalifikacje niezbędne do wykonywania wielu różnorodnych, skomplikowanych zadań o charakterze technicznym, organizacyjnym lub specjalistycznym dla danego obszaru działalności zawodowej. Zadania wymagają wysokiej, osobistej odpowiedzialności i samodzielności, jak również umiejętności kierowania zespołem pracowników.');
INSERT INTO kwalifikacja (id, nazwa, opis) VALUES (5, 'Poziom 5', 'Kwalifikacje niezbędne do wykonywania złożonych zadań, często w sytuacjach problemowych, wymagających podejmowania decyzji o znaczeniu strategicznym dla organizacji. Zadanie te związane są z pełną odpowiedzialnością za pracę i rozwój innych osób, a także wymagają umiejętności diagnozowania, analizowania, prognozowania, planowania oraz wdrażania nowych pomysłów do praktyki gospodarczej i społecznej.');
